import React from 'react';
import { Card, Button, ListGroup } from 'react-bootstrap';
import './riders.css';
import Navbar from '../navSection/Navbar';

const RiderCard = () => {
  <Navbar/>
  return (
    <Card style={{ width: '' }}>
      <div className="d-flex justify-content-center border  align-items-center gap-3">
        <div className="imageRide">
          <img src="/images/ghanajolof.jpg" alt="" />{' '}
        </div>
        <div>
          <Card.Text className="text-end px-3">
            Available balance: <strong>N17,000.00</strong>
          </Card.Text>
          <Card.Title className="text-capitalize">Rider test</Card.Title>
        </div>
      </div>

      {/* Add the URL of the rider's image */}
      <Card.Body>
      <ListGroup className="list-group-flush">
        <ListGroup.Item>Rating: ★★★★☆</ListGroup.Item>
        <ListGroup.Item>Status: 173 rides completed</ListGroup.Item>
        <ListGroup.Item>Delivery duration: 30m</ListGroup.Item>
        <ListGroup.Item>30km away</ListGroup.Item>
      </ListGroup>
      </Card.Body>
     
        Reviews(36) Test1 nice doing business with you
        {/* Add a See More button that links to the full reviews page */}
        <Button variant="primary">See More</Button>
      
    </Card>
  );
};

export default RiderCard;
